//                                MFEM **NAME**
//
// Compile with: make ex13
//
// Sample runs:
//    ex11 -m ~/broom/Meshes/inline-quad.mesh
//
// These keep the number of degrees of freedom fixed while decreasing
// the element count and increasing the feOrder of the mesh and discretization.
//    ex11 -m ~/broom/Meshes/zsine-q1-r5.mesh -o 1 -r 2
//    ex11 -m ~/broom/Meshes/zsine-q3-r4.mesh -o 3 -r 2
//    ex11 -m ~/broom/Meshes/zsine-q7-r3.mesh -o 7 -r 2
//
// Description:  This example code solves the steady state linear advection
//               equation omega.grad(u) +sigma_t psi = 0, where omega is the
//               direction of photon travel and sigma_t is the total removal
//               term.
//
//               The example demonstrates the use of Discontinuous Galerkin (DG)
//               bilinear forms in MFEM (face integrators) with a linear solve
//               for an advection-like equation.

#include "mfem.hpp"
#include <fstream>
#include <iostream>
#include <algorithm>
#include <stdlib.h>
#include <sstream>
#include <cstring>
#include <vector>
#include "BroomConfig.hh"
#include "Quadrature.hpp"
#include "physics.hpp"
#include "Solve.hpp"
#include "MeshLoader.hh"
#include "tryOptions.hh"
#include <cstdio>
#if defined(BROOM_USE_MPI)
#include <mpi.h>
#endif

#if defined(__linux__)
#include <fenv.h>
#endif

using namespace std;
using namespace mfem;

// The discrete ordinates direction.  It is really constant.
void omega_function(const Vector &x, Vector &v);

// Initial condition
double psi0_function(Vector &x);
double sigma_t_function(Vector &x);
double sigma_s_function(Vector &x);
double qext_function(Vector &x);
double refSol_function(Vector &x);

// Inflow boundary condition
double inflow_function(Vector &x);

int main(int argc, char *argv[]) {

  int myRank = 0;
  int numProcs = 1;

#if defined(BROOM_USE_MPI)
  MPI_Init(&argc, &argv);
  MPI_Comm_rank(MPI_COMM_WORLD, &myRank);
  MPI_Comm_size(MPI_COMM_WORLD, &numProcs);
#endif

#if defined(__linux__)
  feenableexcept(FE_DIVBYZERO);
  feenableexcept(FE_INVALID);
  feenableexcept(FE_OVERFLOW);
#endif

  // CONSTRUCTOR
  // 1. Parse command-line options.
  // const char *mesh_file = "../../../broom/Meshes/inline-quad.mesh";
  // const char *mesh_file = "../../../broom/Meshes/periodic-square-2.mesh";
  // const char *mesh_file = "../../../broom/Meshes/UnsQuad.0.mesh";
  // const char *mesh_file = "../../../broom/Meshes/oneD.mesh";

  int ref_levels = tryOption("-r", "refinement levels", argc, argv, 0);
  int SnOrder = tryOption("-s", "Sn quadrature order", argc, argv, 8);
  int feOrder = tryOption("-e", "Finite element order", argc, argv, 1);
  int meshOrder = tryOption("-g", "Geometry (mesh) order", argc, argv, -1);
  double meshDistortionAlpha =
      tryOption("-a", "mesh distortion magnitude", argc, argv, -1.0);
  bool visit =
      tryOption("--visit", "--no-visit", "Dump vis files", argc, argv, true);
  bool directSolve =
      tryOption("--directSolve", "--no-directSolve",
                "Do a direct sparse solve using UMFPACK", argc, argv, true);
  std::string mesh_file = tryOption("-m", "Mesh file", argc, argv,
                                    "../../../broom/Meshes/oneD.mesh");
  std::string meshDistortion =
      tryOption("-d", "Mesh distortion", argc, argv, "none");
  double tolerance =
      tryOption("-t", "Source iteration tolerance", argc, argv, 1.0e-12);
  double initialGuess =
      tryOption("-p", "Initial guess for phi", argc, argv, 1 / 0.7);
  int scatIter =
      tryOption("-i", "Max scattering source iterations", argc, argv, 1000);

  int precision = 8;
  std::cout.precision(precision);

  int quadType = tryOption("--quadType", "Quadrature order type [1=LS from Cheuck, 2=LS from Ardra]", argc, argv, 2);

  char quadFile[100];
  if( quadType == 1)
  {
     sprintf(quadFile, "../../../broom/src/LS Quadratures/LS_%d.txt", SnOrder / 2);
  }
  else
  {
     sprintf(quadFile, "../../../broom/src/LS Quadratures2/S%d_LS_from_ARDRA.txt", SnOrder);
  }

  Quadrature quadrature(quadFile, SnOrder);

  const int numAngles = quadrature.getNumAngles();

  // Hack to copy data into global vairables so that mfem function's can access
  // them.
  mu = quadrature.getMu();
  eta = quadrature.getEta();
  w = quadrature.getWeight();

  MeshLoader meshLoader(mesh_file, meshOrder, feOrder, ref_levels,
                        meshDistortion, meshDistortionAlpha);

  Mesh &mesh(meshLoader.getMesh());
  mesh.PrintCharacteristics();
  int dim = mesh.Dimension();

  // 4. Define the discontinuous DG finite element space of the given
  //    polynomial feOrder on the refined mesh.
  DG_FECollection fec(feOrder, dim);
  FiniteElementSpace fes(&mesh, &fec);
  // FES for linear step differencing reference solution
  DG_FECollection fec2(0, dim);
  FiniteElementSpace fes2(&mesh, &fec2);

  if (myRank == 0) {
    std::cout << "Number of unknowns: " << fes.GetVSize() << '\n';
    std::cout << "Number of zones: " << mesh.GetNE() << '\n';
  }

  GridFunction phi_old(&fes);
  GridFunction phi_conv(&fes);
  GridFunction lphi(&fes);
  GridFunction gphi(&fes);
  double phi_conv_num(1), phi_conv_denom(1), spec_radius(1);
  vector<double> sigma_s(phi_old.Size());
  GridFunction sigma_t_vis(&fes);
  GridFunction sigma_s_vis(&fes);
  GridFunction scat_src_vis(&fes);
  GridFunction qext_vis(&fes);
  GridFunction psi0_vis(&fes);
  FunctionCoefficient refSol(refSol_function);
  GridFunction refSol_vis(&fes2);
  refSol_vis.ProjectCoefficient(refSol);

  // Initialize
  for (int i = 0; i < phi_old.Size(); i++) {
    phi_old[i] = initialGuess;
    phi_conv[i] = 0;
    lphi[i] = 0;
  }

  /// SOLVE function ( all the physics functions)
  // LOOP OVER PHI TO CONVERGE //
  int converge = 0;
  int cntconv = 0;
  while (converge == 0 && cntconv < scatIter) {
    // LOOP OVER OMEGA
    for (int qloop = 0; qloop < numAngles / numProcs; qloop++) {
      Solve solve(dim, qloop, q, omega_function, inflow_function, psi0_function,
                  sigma_t_function, sigma_s_function, qext_function, fes,
                  phi_old, lphi, myRank, numAngles, numProcs, directSolve);

      sigma_t_vis = solve.getSigt();
      sigma_s_vis = solve.getSigs();
      qext_vis = solve.getQext();
      scat_src_vis = solve.getScatSrc();
      psi0_vis = solve.getPsi0();
    } // END LOOP OVER OMEGA

#if defined(BROOM_USE_MPI)
    gphi = 0;

    MPI_Allreduce(lphi.GetData(), gphi.GetData(), phi_old.Size(), MPI_DOUBLE,
                  MPI_SUM, MPI_COMM_WORLD);
#else
    gphi = lphi;
#endif

    /// SAVE function
    VisItDataCollection visit_dc("reed_hill", &mesh);
    visit_dc.RegisterField("phi", &gphi);
    visit_dc.RegisterField("refSol", &refSol_vis);
    // visit_dc.RegisterField("psi", &psi);
    visit_dc.RegisterField("sigma_t", &sigma_t_vis);
    visit_dc.RegisterField("sigma_s", &sigma_s_vis);
    visit_dc.RegisterField("scat_src", &scat_src_vis);
    visit_dc.RegisterField("S_0", &qext_vis);
    visit_dc.RegisterField("psi0", &psi0_vis);
    if (visit) {
      visit_dc.SetCycle(0);
      visit_dc.SetTime(0.0);
      visit_dc.Save();
      if (myRank == 0) {
        cout << "L2 error: " << gphi.ComputeL2Error(refSol) << "\n";
      }
    }

    /// POST-SWEEP UPDATE FUNCTION
    swap(gphi, phi_old);
    for (int i = 0; i < gphi.Size();
         i++) // calculate delta phi between iterations
    {
      phi_conv[i] = phi_old[i] - gphi[i];
      if (phi_conv[i] < 0) // only want positive magnitudes
      {
        phi_conv[i] = -phi_conv[i];
      }
    }

    for (int i = 0; i < gphi.Size(); i++) {
      gphi[i] = 0;
      lphi[i] = 0;
    }
    // Check for Convergence
    double phiMax = phi_conv.Max();
    phi_conv_num = phiMax;
    spec_radius = phi_conv_num / phi_conv_denom;

    if (myRank == 0) {
      cout << "Itr = " << cntconv << ", phi_conv.max =  " << phiMax
           << ", spectral radius: " << spec_radius << "\n";
    }

    phi_conv_denom = phi_conv_num;
    if (phi_conv_num < tolerance * (1 - spec_radius) * phi_old.Max()) {
      converge = 1;
      if (myRank == 0) {
        cout << "BINGO, converged"
             << "\n";
        cout << "scattering source iterations: " << cntconv << "\n";
      }
    }

    cntconv++;

  } // END CONVERGE LOOP

#if defined(BROOM_USE_MPI)
  MPI_Finalize();
#endif

  return 0;
}

// The **NOT** constant direction of the discrete ordinate
void omega_function(const Vector &x, Vector &v) {
  int dim = x.Size();
  if (dim == 1) {
    v(0) = mu[q];
  } else if (dim == 2) {
    v(0) = mu[q];
    v(1) = eta[q];
  } else {
    v(0) = mu[q];
    v(1) = eta[q];
    v(2) = xi[q];
  }
}

// Initial condition
double psi0_function(Vector &x) { return 0.0; }

// The absorption term
double sigma_t_function(Vector &x) {
#if 1
  if (x[0] < 3 || x[0] > 13) {
    return 1;
  } else if (x[0] < 5 || x[0] > 11) {
    return 0;
  } else if (x[0] < 6 || x[0] > 10) {
    return 5;
  } else {
    return 50;
  }
#else
  if (x[0] < 3) {
    return 1;
  } else if (x[0] < 5) {
    return 0;
  } else if (x[0] < 6) {
    return 5;
  } else {
    return 50;
  }
#endif
}
double sigma_s_function(Vector &x) {
#if 1
  if (x[0] < 3 || x[0] > 13) {
    return 0.9;
  } else {
    return 0;
  }
#else
  if (x[0] < 3) {
    return 0.9;
  } else {
    return 0;
  }
#endif
}

double qext_function(Vector &x) {
  //     [q = S_0 / (4*pi)]
#if 1
  if ((x[0] > 2 && x[0] < 3) || (x[0] > 13 && x[0] < 14)) {
    return 1 / (4 * M_PI);
  } else if (x[0] > 6 && x[0] < 10) {
    return 50 / (4 * M_PI);
  } else {
    return 0;
  }
#else
  if (x[0] > 2 && x[0] < 3) {
    return 1 / (4 * M_PI);
  } else if (x[0] > 6) {
    return 50 / (4 * M_PI);
  } else {
    return 0;
  }
#endif
}

// Inflow boundary condition (zero for the problems considered in this example)
double inflow_function(Vector &x) {
  // I noticed this value penetrates the entire problem domain.
  { return 0; }
}

